import React from "react";
import { useState } from "react";

const initialcount = 0
const initialuser = {name: "", password: ""}
const UseState = () => {
    const [count, setCount] = useState(initialcount)
    const [user, setUser] =  useState(initialuser)
    const Count = () =>{
        setCount(count + 1)
    }
    const Submit = () =>{
        setUser(user)
        console.log(user)
    }
    return(
        <div>
            <div> count : {count}</div>
            <button type="button" onClick={Count}>Count</button>
            <input type="text" value={user.name} onChange={e => setUser(e.target.value)}/>
            <input type="text" value={user.password} onChange={e => setUser(e.target.value)}/>
            <button type="btn" onClick={Submit}></button>

        </div>
    )
}
export default UseState
